import { Outlet, Navigate } from 'react-router-dom';

const PrivateRoute = () => {
  const {userAuth} = sessionStorage.getItem("userAuth");

  console.log(userAuth)
  return (userAuth.isAuth === "true") ? <Outlet /> : <Navigate to="/login" />;
};

export default PrivateRoute;
